import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [categorias, setCategorias] = useState([]);
  const [produtos, setProdutos] = useState([]);
  const [carregando, setCarregando] = useState(true);

  // Carregar dados da API Laravel
  useEffect(() => {
    const carregarDados = async () => {
      try {
        console.log('üîÑ Conectando com a API...');
        
        // Buscar categorias
        const respostaCategorias = await fetch('http://localhost:8000/api/categorias');
        const dadosCategorias = await respostaCategorias.json();
        setCategorias(dadosCategorias);

        // Buscar produtos
        const respostaProdutos = await fetch('http://localhost:8000/api/produtos');
        const dadosProdutos = await respostaProdutos.json();
        setProdutos(dadosProdutos);

        setCarregando(false);
        console.log('‚úÖ Dados carregados da API!');
        
      } catch (erro) {
        console.error('‚ùå Erro ao carregar dados da API:', erro);
        setCarregando(false);
      }
    };

    carregarDados();
  }, []);

  if (carregando) {
    return (
      <div style={{ textAlign: 'center', padding: '50px' }}>
        <h2>üçî Jetro's Lanches</h2>
        <p>Carregando card√°pio...</p>
      </div>
    );
  }

  return (
    <div className="App">
      <header style={{ backgroundColor: '#b71c1c', color: 'white', padding: '20px', textAlign: 'center' }}>
        <h1>üçî Jetro's Lanches</h1>
        <p>Card√°pio Digital</p>
        <p>üìû 99611-2820 | 3822-7097</p>
      </header>

      <main style={{ padding: '20px' }}>
        <div style={{ textAlign: 'center', marginBottom: '30px' }}>
          <h2>Card√°pio Digital</h2>
          <p>Total: {categorias.length} categorias e {produtos.length} produtos carregados da API</p>
        </div>

        {categorias.map(categoria => (
          <section key={categoria.id} style={{ marginBottom: '40px' }}>
            <h3 style={{ 
              backgroundColor: '#f5f5f5', 
              padding: '10px', 
              borderLeft: '5px solid #b71c1c',
              color: '#b71c1c'
            }}>
              {categoria.nome}
            </h3>
            <p style={{ color: '#666' }}>{categoria.descricao}</p>
            
            <div className="produtos">
              {produtos
                .filter(produto => produto.categoria_id === categoria.id)
                .map(produto => (
                  <div key={produto.id} style={{
                    border: '1px solid #ddd',
                    padding: '15px',
                    margin: '10px 0',
                    borderRadius: '5px'
                  }}>
                    <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'start' }}>
                      <h4 style={{ margin: '0', color: '#333' }}>{produto.nome}</h4>
                      <span style={{ 
                        backgroundColor: '#2e7d32', 
                        color: 'white', 
                        padding: '5px 10px', 
                        borderRadius: '3px',
                        fontWeight: 'bold'
                      }}>
                        R$ {produto.preco}
                      </span>
                    </div>
                    {produto.descricao && (
                      <p style={{ color: '#666', margin: '10px 0 0 0' }}>{produto.descricao}</p>
                    )}
                  </div>
                ))
              }
            </div>
          </section>
        ))}
      </main>

      <footer style={{ 
        backgroundColor: '#333', 
        color: 'white', 
        padding: '20px', 
        textAlign: 'center',
        marginTop: '40px'
      }}>
        <p>&copy; 2024 Jetro's Lanches. Todos os direitos reservados.</p>
      </footer>
    </div>
  );
}

export default App;
